import Vue from "vue";
import VueRouter from "vue-router";
import tabLayout from '@components/layoutManage/tabLayout'
import baseLayout from '@components/layoutManage/baseLayout'
import Pages from './page'
// 解决路由异常报错问题
const original = VueRouter.prototype.replace
VueRouter.prototype.replace = function replace(location) {
  return original.call(this, location).catch(err => err)
}

Vue.use(VueRouter);

const routes = [
    {
      path: "/",
      name: "entrance",
      component: Pages.entrance,
      componentName: 'entrance/entrance',
      meta: { 
        title: '潮级VIP'
      }
    },
    {
      path: '/common',
      component: baseLayout,
      children: [
        {
          path: '/common/commonMap',
          name: 'commonMap',
          desc: '地图',
          component: Pages.commonMap,
          componentName: 'common/commonMap',
          meta:{
            title:'潮级VIP'
          }
        },
      ]
    },
    {
      path: '/index',
      component: tabLayout,
      children: [
        {
          path: '/index/home',
          name: 'home',
          desc: '首页',
          componentName: 'home/home',
          component: Pages.home,
          meta:{
            title:'潮级VIP',
            keepAlive: true
          }
        },
        {
          path: '/index/center',
          name: 'center',
          desc: '个人中心',
          component: Pages.center,
          componentName: 'center/center',
          meta:{
            title:'个人中心',
          }
        }
      ]
    },
    {
      path: '/home',
      component: baseLayout,
      children: [
        {
          path: '/home/search',
          name: 'search',
          desc: '搜索',
          component: Pages.search,
          componentName: 'home/search',
          meta:{
            title:'潮级VIP'
          }
        },
      ]
    },
    {
      path: '/center',
      component: baseLayout,
      children: [
        {
          path: '/center/joinVip',
          name: 'joinVip',
          desc: '开通会员',
          component: Pages.joinVip,
          componentName: 'center/joinVip',
          meta:{
            title:'潮级VIP'
          }
        },
        {
          path: '/center/protocol',
          name: 'protocol',
          desc: '协议',
          component: Pages.protocol,
          componentName: 'center/protocol',
          meta:{
            title:'潮级VIP'
          }
        },
        {
          path: '/center/redPacket',
          name: 'redPacket',
          desc: '红包',
          component: Pages.redPacket,
          componentName: 'center/redPacket',
          meta:{
            title:'红包'
          }
        },
      ]
    },
    {
      path: '/shop',
      component: baseLayout,
      children: [
        {
          path: '/shop/shopDetail',
          name: 'shopDetail',
          desc: '店铺详情',
          component: Pages.shopDetail,
          componentName: 'shop/shopDetail',
          meta:{
            title:'店铺详情'
          }
        },
        {
          path: '/shop/applyShop',
          name: 'applyShop',
          desc: '适用店铺',
          componentName: 'shop/applyShop',
          component: Pages.applyShop,
          meta:{
            title:'适用店铺'
          }
        },
        {
          path: '/shop/applyAddressShop',
          name: 'applyAddressShop',
          desc: '适用门店',
          component: Pages.applyAddressShop,
          componentName: 'shop/applyAddressShop',
          meta:{
            title:'适用门店'
          }
        },
      ]
    },
    {
      path: '/coupon',
      component: baseLayout,
      children: [
        {
          path: '/coupon/couponList',
          name: 'couponList',
          desc: '我的卡券',
          component: Pages.couponList,
          componentName: 'coupon/couponList',
          meta:{
            title:'我的卡券',
            keepAlive: true // 需要被缓存
          }
        },
        {
          path: '/coupon/couponDetail',
          name: 'couponDetail',
          desc: '卡券详情',
          component: Pages.couponDetail,
          componentName: 'coupon/couponDetail',
          meta:{
            title:'卡券详情'
          }
        },
        {
          path: '/coupon/travelCardDetails',
          name: 'travelCardDetails',
          desc: '自我游卡券详情',
          component: Pages.travelCardDetails,
          componentName: 'coupon/travelCardDetails',
          meta:{
            title:'卡券详情'
          }
        },

      ]
    },
    {
      path: '/active',
      component: baseLayout,
      children: [
        {
          path: '/active/specialSale',
          name: 'specialSale',
          desc: '特卖活动',
          componentName: 'active/specialSale',
          component: Pages.specialSale,
          meta:{
            title:'潮级VIP',
            // keepAlive: true // 需要被缓存
          }
        },
        {
          path: '/active/specialSaleSuccess',
          name: 'specialSaleSuccess',
          desc: '特卖活动成功页',
          componentName: 'active/specialSaleSuccess',
          component: Pages.specialSaleSuccess,
          meta:{
            title:'潮级VIP',
            // keepAlive: true // 需要被缓存
          }
        },
        {
          path: '/active/giftBag',
          name: 'giftBag',
          desc: '大礼包活动',
          componentName: 'active/giftBag',
          component: Pages.giftBag,
          meta:{
            title:'潮级VIP',
            // keepAlive: true // 需要被缓存
          }
        },
        {
          path: '/active/giftBagSuccess',
          name: 'giftBagSuccess',
          desc: '大礼包活动',
          componentName: 'active/giftBagSuccess',
          component: Pages.giftBagSuccess,
          meta:{
            title:'潮级VIP',
            // keepAlive: true // 需要被缓存
          }
        },
        {
          path: '/active/submitOrder',
          name: 'submitOrder',
          desc: '活动下单',
          componentName: 'active/submitOrder',
          component: Pages.submitOrder,
          meta:{
            title:'潮级VIP',
            keepAlive: true // 需要被缓存
          }
        },
        {
          path: '/active/travelInformation',
          name: 'travelInformation',
          desc: '用户信息',
          componentName: 'active/travelInformation',
          component: Pages.travelInformation,
          meta:{
            title:'填写信息',
            // keepAlive: true // 需要被缓存
          }
        },
        {
          path: '/active/activeCoupon',
          name: 'activeCoupon',
          desc: '卡券详情',
          componentName: 'active/activeCoupon',
          component: Pages.activeCoupon,
          meta: {
            title:'卡券详情',
            // keepAlive: true // 需要被缓存
          }
        },
        {
          path: '/active/spellGroup',
          name: 'spellGroup',
          desc: '拼团',
          componentName: 'active/spellGroup',
          component: Pages.spellGroup,
          meta:{
            title:'拼团',
            // keepAlive: true // 需要被缓存
          }
        },
        {
          path: '/active/spellGroupResult',
          name: 'spellGroupResult',
          desc: '拼团',
          componentName: 'active/spellGroupResult',
          component: Pages.spellGroup,
          meta:{
            title:'拼团',
            // keepAlive: true // 需要被缓存
          }
        },
      ]
    },
    {
      path: '/order',
      component: baseLayout,
      children: [
        {
          path: '/order/orderList',
          name: 'orderList',
          desc: '我的订单',
          componentName: 'order/orderList',
          component: Pages.orderList,
          meta:{
            title:'我的订单',
            keepAlive: true
          }
        },
        {
          path: '/order/orderDetail',
          name: 'orderDetail',
          desc: '订单详情',
          componentName: 'order/orderDetail',
          component: Pages.orderDetail,
          meta:{
            title:'订单详情'
          }
        },
        {
          path: '/order/refund',
          name: 'refund',
          desc: '退款',
          componentName: 'order/refund',
          component: Pages.refund,
          meta:{
            title:'退款'
          }
        },
      ]
    },
    {
      path: "/error",
      name: "error",
      componentName: 'error/error',
      component: Pages.error,
      meta: { 
        title: '404'
       }
    },
    {
      path: '*',  // * 表示上面路径匹配不到的都显示这个页面
      name: '404',
      componentName: 'error/404',
      component: Pages['404'],
      meta: { 
        title: '404'
      }
    },
  ];
  


export default new VueRouter({
  // mode: 'hash',
  mode: 'history',
  base: process.env.BASE_URL,
  routes
})
